import Accordion from 'react-bootstrap/Accordion';
import styled from 'styled-components';

function AllCollapseExample() {
    const Style = styled.div`
    padding: 20px 20px;
    font-size: 50px;
    font-family: "Jua";
    `

    return (
    <>
    <Style>자주하는 질문 <i class="fa-solid fa-person-circle-question" style={{fontSize: "40px"}}></i></Style>
    <Accordion>
      <Accordion.Item eventKey="0">
        <Accordion.Header>식물을 따로 구매하고 싶습니다!</Accordion.Header>
        <Accordion.Body>
        저희는 식물을 따로 판매하는 업체가 아닙니다. 무료 분양하는 서비스를 제공하고 있으니 커뮤니티에 식물마켓을 둘러보시는걸 추천드립니다.
        </Accordion.Body>
      </Accordion.Item>
      <Accordion.Item eventKey="1">
        <Accordion.Header>Accordion Item #2</Accordion.Header>
        <Accordion.Body>

        </Accordion.Body>
      </Accordion.Item>
    </Accordion>
    </>
  );
}

export default AllCollapseExample;
